export default function Password() {
    const [pass, setPass] = useState("")
    const [eight, setEight] = useState("")

    const verify=(e)=>{
        let received = e.target.value
        setPass(received)

    }
    return(
        <>
        <input type="password" onChange={verify}/>
        <h1>Password {pass}</h1>
        <div className="condition">
            <ul>
                <li>Eight</li>
                <li>Upp</li>
                <li>Low</li>
                <li>Num</li>
                <li>Spl</li>
            </ul>
        </div>
        </>
    )
}
